### Describe the issue

Hi, I am building a xamarin forms application in VS 2022 windows, in the application I used onnxruntime to run a model trained by myself. I first tried run the model in a console application (.net 6) and the inference session was created successfully and the model run prediction correctly. Then I put similar code into xamarin form project and added the onnxruntime nuget package. but this time the project debug/release stuck when :

**var session = new InferenceSession(model, new SessionOptions() { LogSeverityLevel = 0, LogVerbosityLevel = 0});**

I then tried a few different things: 
1. use options = new SessionOptions() { LogSeverityLevel = 0, InterOpNumThreads = 1, IntraOpNumThreads = 1 };
2. change onnxruntime version to 1.10.0 and 1.13.1 (latest)
3. use different IOS build options
4. use or remove mtouch arguments --registrar:dynamic
none of these works.

Then I downloaded the example xamarin forms project CustomVisionSample and this one works in my vs/iphone11 without problem. I then checked the versions of xamarin/.net/onnxruntime referenced in the example project and I could not find anything different to my own project.

Can someone please help me with this? I have stuck on this issue for days

