### Description
<!-- Describe your changes. -->
- Adds a new C API `OrtApi::RegisterCustomOpsLibrary_V2` that manages the lifetime of dynamic library handles (i.e., calls `dlclose` or `FreeLibrary`).
- Deprecates C API `OrtApi::RegisterCustomOpsLibrary`.
- Adds C++ API wrapper for convenient registering of custom op libraries.
- `PySessionOptions` is now an alias of `OrtSessionOptions`


### Motivation and Context
The current API for registering custom op libraries loads dynamic libraries but requires users to handle the release of the corresponding library handles. Additionally, the user has to make sure to release the library handle _after_ the session has been destroyed (or the program segfaults).

Example of current API usage:
```C++
void* library_handle = nullptr;

{  // Create session in an internal/separate scope so that it is destroyed before dll is released.
  Ort::SessionOptions session_options;
  Ort::ThrowOnError(Ort::GetApi().RegisterCustomOpsLibrary(session_options, "my_op.dll", &library_handle));

  // ...

  Ort::Session session(*ort_env, "model.onnx", session_options);
  // Run inference ...
}

// OS-specific library handle cleanup
#ifdef _WIN32
bool success = ::FreeLibrary(reinterpret_cast<HMODULE>(library_handle));
// ... 
#else
int retval = dlclose(library_handle);
// ...
#endif
```

The new API automatically cleans up the library and allows the user to write more straightforward code.

```C++
Ort::SessionOptions session_options;
session_options.RegisterCustomOpsLibrary("my_op.dll");

// ...

Ort::Session session(*ort_env, "model.onnx", session_options);
// Run inference ...
```
